import logo from "../assets/Logo.svg"
import { Link } from "react-router-dom";
function Navbar(){
    return(
        <div>
            
          <Link to="/">
            <img src={logo} width={160} height={160} loading="lazy"></img>
          </Link>
         <nav></nav>

        </div>
    )
}
export default Navbar;
